import React from 'react';
import {BrowserRouter} from 'react-router-dom';

import {BASE_URL , API_KEY} from '../../config.js';

import axios from 'axios';

const Blank_test= () => {
    const [blank, setBlank] = React.useState([]);

    React.useEffect(() =>{
        getBlank();
    }, []);
    
    const getBlank = async() => {
        const res = await axios.get(`${BASE_URL}/genre/movie/list` , {params:{ api_key: API_KEY}});
        console.log(res.data);
        setBlank(res.data.results);
    }
    
    
    
    
    
    return(
    <div style={{marginTop:'4.5%'}}>
        <div>
            {
                blank.map(g_enere => {
                    return <div>{g_enere.name} </div>
                })
            }
        </div>
    </div>
    )
}
export default Blank_test;
